import React, { Component } from "react";
import Jumbotron from "react-bootstrap/Jumbotron";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Typed from "react-typed";

class Hero extends Component {
  render() {
    const { title, subTitle, text } = this.props;
    return (
      <Jumbotron className="bg-transparent jumbotron-fluid p-0">
        <Container fluid={true}>
          <Row className="justify-content-center py-5">
            <Col md={8} sm={12}>
              {title && <h1 className="display-1 font-weight-bolder">{title}</h1>}
              {subTitle && <h3 className="display-4 font-weight-light">{subTitle}</h3>}
              {text && <h3 className="lead font-weight-light">{text}</h3>}
            </Col>
          </Row>
          <Row>
            <div className="section-container" id="typed-home">
              <Typed
                typedRef={(typed) => { this.typed = typed; }}
                strings={["Technology ​for everything wireless and the testing there of..."]}
                typeSpeed={40}
                backSpeed={50}
                loop
              />
            </div>
          </Row>
        </Container>
      </Jumbotron>
    )
  }
}

export default Hero
